import React from 'react';
import { Card } from 'react-bootstrap'
const GalletNft = ({item:{id, email, body}}) => {
    return (
        <div>
            <Card style={{ width: '18rem' }}>
                
                <Card.Body>
                    <Card.Title>ID: {id}</Card.Title>
                    <Card.Text>
                      {email}
                    </Card.Text>
                    <p>{body}</p>
                </Card.Body>
            </Card>
        </div>
    )
}



export default GalletNft;
